import React from 'react'

// import links
import { Link } from 'react-router-dom'

// import image
import guideIMG from '../../assets/images/guide.svg'

const Guide = () => {
  return (
    <>
    <div className="container">
        <div className="flex justify-between gap-[50px] lg:gap-0">
            <div className="">
                <img src={guideIMG} />
            </div>
        </div>
    </div>
    </>
  )
}

export default Guide
